column13:
A computer-implemented method for controlling and/or monitoring equipment (110) of a chemical plant is proposed. The method comprises the following steps: 
a) specifying at least one parameter of a production process to be optimized; 
b) receiving input data via at least one input channel (126), wherein the input data comprises operating conditions of the production process, physical properties of a plant equipment layout, and at least one predicted parameter determined from a physico-chemical white box model (128), wherein the physico-chemical white box model (128) comprises at least one thermodynamics model (130), at least one solid formation model (132) and a computational fluid dynamics (CFD) based numerical simulation (134); 
c) optimizing the specified parameter via at least one processing device (138), wherein the specified parameter is optimized by adapting the operating conditions of the production process and/or the physical properties of the plant equipment layout based on the predicted parameter.
